import React, { useEffect, useState } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function PetDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [pet, setPet] = useState(null);
  const [eventos, setEventos] = useState([]);

  useEffect(() => {
    async function fetchData() {
      try {
        const petRes = await api.get(`/pets/${id}`);
        setPet(petRes.data);

        const eventosRes = await api.get(`/eventos/pet/${id}`);
        setEventos(eventosRes.data);
      } catch (err) {
        console.error('Erro ao buscar dados:', err);
      }
    }
    fetchData();
  }, [id]);

  const handleDelete = async () => {
    if (window.confirm('Tem certeza que deseja excluir este pet?')) {
      try {
        await api.delete(`/pets/${id}`);
        navigate('/pets');
      } catch (err) {
        console.error('Erro ao excluir pet:', err);
      }
    }
  };

  if (!pet) return <p>Carregando pet...</p>;

  return (
    <div className="container my-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h2>Detalhes do Pet</h2>
        <Link to="/pets" className="btn btn-secondary">Voltar à Lista</Link>
      </div>

      <p><strong>Nome:</strong> {pet.nome}</p>
      <p><strong>Espécie:</strong> {pet.especie}</p>
      <p><strong>Raça:</strong> {pet.raca}</p>
      <p><strong>Porte:</strong> {pet.porte}</p>
      <p><strong>Cor:</strong> {pet.cor}</p>
      <p><strong>Sexo:</strong> {pet.sexo}</p>
      <p><strong>Peso:</strong> {pet.peso} kg</p>
      <p><strong>Castrado:</strong> {pet.castrado ? 'Sim' : 'Não'}</p>
      <p><strong>Carteira de Vacinação em Dia:</strong> {pet.vacinado ? 'Sim' : 'Não'}</p>
      <p><strong>Data de Cadastro:</strong> {new Date(pet.dataCadastro).toLocaleDateString()}</p>

      <div className="mb-4">
        <Link to={`/pets/${id}/novo-evento`} className="btn btn-success me-2">Cadastrar Evento</Link>
        <Link to={`/pets/${id}/editar`} className="btn btn-primary me-2">Editar</Link>
        <button onClick={handleDelete} className="btn btn-danger">Excluir</button>
      </div>

      <h5>Eventos relacionados</h5>
      {eventos.length === 0 ? (
        <p>Nenhum evento registrado para este pet.</p>
      ) : (
        <ul className="list-group">
          {eventos.map((evento) => (
            <li key={evento._id} className="list-group-item">
              <strong>{evento.tipo}</strong> - Check-in: {new Date(evento.dataEntrada).toLocaleDateString()} -
              Check-out: {evento.status === 'ativo' ? 'em andamento' : new Date(evento.dataSaida).toLocaleDateString()}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
